import React from 'react';
import PropTypes from 'prop-types';

function Food({name, picture, rating}) {  
return <div>
    <h2>I Like {name}</h2>
    <h4>{rating}/5.0</h4>
    <img src={picture} />
</div>
}

Food.propTypes = {
  name : PropTypes.string.isRequired,
  picture : PropTypes.string.isRequired,
  rating : PropTypes.string.isRequired
}

const foodILike = [{
  id : 1,
  name : 'Henerson',
  image : 'https://tmssl.akamaized.net/images/foto/normal/jordan-henderson-1589453476-38566.jpg',
  rating : 5
},
{
  id : 2,
  name : 'Salah',
  image : 'https://banner2.cleanpng.com/20180602/opl/kisspng-mohamed-salah-liverpool-f-c-premier-league-footba-mohammed-sallah-5b12c5f6798468.9686116715279569824977.jpg',
  rating : 4.9
},
{
  id : 3,
  name : 'Virgil',
  image : 'https://toppng.com/uploads/preview/virgil-van-dijk-11548182255igs99cyeot.png',
  rating : 4.8
}];

function App() {
  return (
    <div>        
        {foodILike.map(dish => (
          <Food key={dish.id} name={dish.name} picture={dish.image} rating={dish.rating} />
        ))}        
    </div>
  );
}

export default App;
